import React, { Component } from 'react';

class Btn extends Component {    
    constructor(){
        super();
        if(this.props.id > 0){
            this.state = {
                color : "#B2DFFC",
            }
        }

    }
    render() {
        return (
            <div>
                <button 
                style={{backgroundColor: this.state.color}} 
                type="button" 
                className="loginButton">로그인</button>
            </div>
        )
    }
}

export default Btn;
